import React from 'react';
import ReactDOM from 'react-dom';
const tasks=['to do shopping','to do house chores']
const element=
<div>
  <h1>My list</h1>
  <ol>
    {tasks.map((task , index)=> <li key= {index}>{task}</li>)}
  </ol>
</div>
ReactDOM.render(element,document.getElementById('root'));
